import React from "react";
import { Button, Form, Container } from "react-bulma-components";
const { Input, Field, Control, Label } = Form;

function BookForm() {
  return (
    <Container>
      <Field>
        <Label>Username</Label>
        <Input></Input>
      </Field>
      <Button.Group>
        <Button
          fullwidth
          rounded
          color="primary"
          onClick={() => console.log("ok")}
        >
          Login
        </Button>
      </Button.Group>
    </Container>
  );
}

export default BookForm;
